import React from "react";

class Informacoes extends Component {
    render(props) {
        return (
            <div>
                <h1>Nome: {props.nome}</h1>
                <h1>Curso: {props.curso}</h1>
                <h1>Turno: {props.turno}</h1>
                <h1>Universidade: {props.universidade}</h1>
            </div>
        )
    }
}

export default Informacoes
